function PostList({ data }) {
    useEffect(() => {
        getServerSideProps();
    });
    console.log(data);

    return (
        <div>Posts Page</div>
    )// Render data...
}

export async function getServerSideProps() {
    console.log("fetched");

    const res = await fetch(`https://jsonplaceholder.typicode.com/posts`);
    const data = await res.json();

    return { props: { data } }
}

export default PostList
